const base64String = ""

var imgObj image.Image

func init() {
	img, err := imageFromBase64(base64String)
	if err != nil {
		fmt.Println("Error creating image from base64 string:", err)
		panic("Error Creating Image Object")
	}
	imgObj = img
}
