// A function to create an image.Image from a base64 string
func imageFromBase64(base64String string) (image.Image, error) {
	// Optional: Handle data URI scheme (e.g., "data:image/png;base64,...")
	if strings.Contains(base64String, ",") {
		parts := strings.Split(base64String, ",")
		base64String = parts[1]
	}

	// Decode the base64 string to a byte slice
	decodedBytes, err := base64.StdEncoding.DecodeString(base64String)
	if err != nil {
		return nil, fmt.Errorf("failed to decode base64: %w", err)
	}

	// Create a reader from the byte slice
	reader := strings.NewReader(string(decodedBytes))

	// Decode the image bytes to an image.Image object.
	// The image.Decode function automatically detects the image format (PNG, JPEG, GIF, etc.).
	img, format, err := image.Decode(reader)
	if err != nil {
		return nil, fmt.Errorf("failed to decode image: %w", err)
	}

	fmt.Printf("Detected image format: %s\n", format)
	return img, nil
}
